  false,\n\t\"url\": null,\n\t\"notes\": \"Combining districts alter the use or development
  standards of a base district. rnCombining districts can be in geographically specific
  areas or property rnspecific, as opposed to overlay districts, which are not applied
  to single rnproperties in isolation. Overlay districts add additional zoning standards
  to rnthe base district such as building heights, impervious cover, and setbacks.
  rnOverlay districts are in geographically specific areas and are not typically rnproperty
  specific. Note: This dataset does not include conditional overlay (CO) rncombining
  districts. These are included in the base zoning GIS layer. rnrnList of Combining
  and Overlay Districts: rnrnAirport ZoningrnBarton Springs ZonernCapitol DominancernCapitol
  View CorridorsrnCongress AvernConvention CenterrnCURErnDowntown CreeksrnDowntown
  ParksrnE 6th Street PecanrnHazardous PipelinesrnHill Country RoadwaysrnJustice CenterrnNational
  Registry DistrictsrnNCCDrnNorth Burnet GatewayrnScenic RoadwaysrnUniversity NeighborhoodrnUrban
  RenewalrnWaterfrontrnWaterfront SetbacksrnResidential Design StandardsrnTransit
  Oriented DevelopmentrnThis product is for informational purposes and may not have
  been prepared for or be suitable for legal, engineering, or surveying purposes.
  rnIt does not represent an on-the-ground survey and represents only the approximate
  relative location of property boundaries. rnThis product has been produced by the
  Communications and Technology Department for the sole purpose of geographic reference.
  rnNo warranty is made by the City of Austin regarding specific accuracy or completeness.\",\n\t\"license_title\":
